import React from 'react';

const Navigation = ({onRouteChange, isSignedIn}) => {
		if (isSignedIn) {
			return (
		   <nav style={{display:'flex', justifyContent:'flex-end'}}>
		   <p onClick={() => onRouteChange('SignIn')} className='f3 link dim black underline pa3 pointer'>SignOut</p>
		   </nav>
		   )
		} else {
			return (
			<nav style={{display:'flex', justifyContent:'flex-end'}}>
		   <p onClick={() => onRouteChange('')} className='f3 link dim black underline pa3 pointer'>Sign In</p>
		   <p onClick={() => onRouteChange('Home')} className='f3 link dim black underline pa3 pointer'>Register</p>
		   </nav>
		   )
	 }
}

export default Navigation;
